import { Router } from 'express';
import Schedule from '../../models/Schedule';
import CompetitionBet from '../../models/CompetitionBet'
var url = require('url');
const router = Router();

const daySeconds = 86400000
const range = 3
//req.query.gameDateTime = new Date("2021-06-16")
router.get('/Games', async function (req, res) {
    try {
        let q = url.parse(req.url, true);
        let gameDateTime = new Date(q.query.gameDateTime);
        gameDateTime.setHours(gameDateTime.getHours() + 8)
        // let games = await Schedule.find(
        // {"gameDateTime":{
        //     $gte:new Date(gameDateTime.getDate() - daySeconds * range),
        //     $lte:new Date(gameDateTime.get() + daySeconds * range)}
        // })
        let games = await Schedule.find({"gameDateTime": gameDateTime})
        const today = []
        for(const game of games) {
            game = game.toObject()
            let bets = await CompetitionBet.findOne({'gameID': game.gameID}, 'homebets awaybets')
            if(!bets) {
                bets = new CompetitionBet({gameID: game.gameID, homebets:100000, awaybets:100000})
                await bets.save()
            }
            game['homebets'] = bets.homebets
            game['awaybets'] = bets.awaybets
            today.push(game)
            // if(game.gameDateTime < gameDateTime) { 
            //   before.push(game)
            // }
            // else if (game.gameDateTime > gameDateTime)
            //   after.push(game)
            // else 
        }
        res.status(200).send({
            type: 'success',
            // before: before,
            today: today,
            // after: after
        })
    } catch (e) {
        console.log(e)
        res.status(200).json({
            type: "error",
            message: 'server went wrong' 
        });
    }
});


export default router;

