import { Router } from 'express';
import User from '../../models/User';
import CompetitionBet from '../../models/CompetitionBet';
import Bet from '../../models/Bet'

const router = Router();



router.post('/newBet', async function (req, res) {
    try {
        console.log(req.body)
        const { username, gameID, type, money } = req.body
        if(type != "away" && type != "home") {
            res.status(200).json({
                type: "error",
                message: 'type should be "home" or "away"!' 
            });
            return 
        }
        if(money <= 0) {
            res.status(200).json({
                type: "error",
                message: 'money can\'t less or equal to zero!' 
            });
            return 
        }
        const user = await User.findOne({name: username})
        if(!user) {
            res.status(200).json({
                type: "error",
                message: 'user not found' 
            });
            return 
        }
        const odds = await CompetitionBet.findOne({gameID:gameID})
        if(!odds) {
            res.status(200).json({
                type: "error",
                message: 'game not found' 
            });
            return 
        }
        const newBet = new Bet({
            user: user, 
            gameID: gameID,
            win: "unknown", //有沒有贏 "true", "false", "unknown"
            draw: false, //有沒有領取了
            type: type, // home or away
            money: money,
            createdAt: new Date(),
        })
        await newBet.save()
        user.money -= money
        user.bets.push(newBet)
        await user.save()
        if(type == "home") {
            odds.homebets += money
        }
        else {
            odds.awaybets += money
        }
        await odds.save()
        res.status(200).send({
            type: 'success',
            user
        })
    } catch (e) {
        res.status(200).json({
            type: "error",
            message: 'Bet has problem' 
        });
    }
});


export default router;

